class CallToAmbiguousMethodsTest
{
    public static void charMethod(char n)
    {
        System.out.println(n);
    }

    public static void byteMethod(byte n)
    {
        System.out.println(n);
    }

    public static void longMethod(long n)
    {
        System.out.println(n);
    }

    public static void doubleMethod(double n)
    {
        System.out.println(n);
    }
}
